import React from "react";
import "./ProjectCard.scss";
import { Draggable } from "react-beautiful-dnd";

export default function ProjectCard(props) {
  return (
    <Draggable draggableId={props.id} index={props.index}>
      <div>
        <h1>{props.title}</h1>
      </div>
    </Draggable>
  );
}

